let types = ["CZ75-Auto","Desert Eagle","Dual Berettas","Five-SeveN","Glock-18","P2000","P250","R8 Revolver","Tec-9","USP-S","Zeus x27","MAC-10","MP5-SD","MP7","MP9","P90","PP-Bizon","UMP-45","MAG-7","Nova","Sawed-Off","XM1014","M249","Negev","AK-47","AUG","FAMAS","Galil AR","M4A1-S","M4A4","SG 553","AWP","G3SG1","SCAR-20","SSG 08","All Guns","Knives"];

for (let i = 0; i < types.length; i++) {
    let aOption = document.createElement("option");
    aOption.textContent = types[i];
    aOption.value = types[i];
    document.getElementById("skinTypeSelector").appendChild(aOption);
}

document.getElementById("skinTypeSelector").value = "AWP"

function randomizeSkin() {
    if (document.getElementById("skinTypeSelector").value == "Knives") {
        skinPool = knifeSkins;
    } else if (document.getElementById("skinTypeSelector").value == "All Guns") {
        skinPool = gunSkins;
    } else {
        skinPool = gunSkins.filter((skin) => skin.split(" - ")[0] == document.getElementById("skinTypeSelector").value);
    }
    skinIndex = Math.floor(Math.random() * skinPool.length);
    chosen_skin = skinPool[skinIndex];

    if (document.getElementById("iTypeSelector").value == "Gun") {
        skin_correct_string = chosen_skin.split(" - ")[0];
    } else if (document.getElementById("iTypeSelector").value == "Skin") {
        skin_correct_string = chosen_skin.split(" - ")[1].split(".")[0];
    } else {
        skin_correct_string = chosen_skin.split(".")[0];
    }
    console.log(`Answer: ${skin_correct_string}`);

    if (document.getElementById("skinTypeSelector").value == "Knives") {
        document.getElementById('skinPic').src = `.\\All CS Knives\\${chosen_skin}`;
    } else {
        document.getElementById('skinPic').src = `.\\All CS Guns\\${chosen_skin}`;
    }
}

randomizeSkin()

document.addEventListener("keypress", (e) => {
    if (e.key == "Enter") {
    skinGuess = document.getElementById("guessBox").value;
    if (skinGuess == skin_correct_string){
        document.getElementById("guessCheck").textContent = "CORRECT";
        document.getElementById("guessCheck").style.color = "green";
        document.getElementById("correctName").textContent = "";
        correctAns ++;
    } else {
        document.getElementById("guessCheck").textContent = "INCORRECT";
        document.getElementById("guessCheck").style.color = "red";
        document.getElementById("correctName").textContent = `Previous Answer: ${skin_correct_string}`;
    }
    document.getElementById("guessBox").value = "";
    randomizeSkin();
    qCount ++;
    document.getElementById("aLabel").textContent = `Accuracy: ${correctAns}/${qCount} (${Math.round(100 * correctAns / qCount)}%)`;

    }
});
document.getElementById("iTypeSelector").addEventListener("change", () => {
    randomizeSkin();
    document.getElementById("resetButton").click();
});

document.getElementById("skinTypeSelector").addEventListener("change", () => {
    randomizeSkin();
    document.getElementById("resetButton").click();
});

document.getElementById("resetButton").addEventListener("click",() => {
    qCount = 0;
    correctAns = 0;
    document.getElementById("aLabel").textContent = "Accuracy: 0/0 (100%)";
});